pragma solidity ^0.8;

contract Test1{
    address public owner = msg.sender;
    function setOwner(address newOwner)public{
        require(msg.sender == owner,"cant not use this");
        owner = newOwner;
    }
}

contract Test2{
    address public owner  = msg.sender;
}

contract Proxy{
    function deploy(bytes memory _code)external{
        new Test1();
    }
}

